INSERT INTO review (restaurant_name, title, content, created_at) VALUES ('미소식당', '맛있는 고기와 친절한 서비스', '미소식당은 일식 레스토랑 중 최고였습니다. 신선한 재료와 정교한 조리로 어떤 요리도 완벽하게 즐길 수 있었습니다.', '2023-11-08')
INSERT INTO review (restaurant_name, title, content, created_at) VALUES ('이탈리안 피자 퍼펙션', '요리의 신비: 이탈리안 피자 미식 탐험', '이탈리안 피자 퍼펙션은 진정한 이탈리안 피자의 맛을 즐길 수 있는 곳이었습니다. 박식한 피자와 친절한 서비스로 훌륭한 경험을 제공했습니다.', '2023-11-09')
INSERT INTO review (restaurant_name, title, content, created_at) VALUES ('미소식당', '다국적 요리의 풍부한 맛', '풍미한 레스토랑은 다양한 나라의 요리를 경험할 수 있는 곳이었습니다. 다국적 요리의 다양성과 맛있는 음식을 즐겼습니다.', '2023-11-10')
INSERT INTO review (restaurant_name, title, content, created_at) VALUES ('바베큐 킹덤', '고기를 사랑하는 이들을 위한 천국', '고기의 낙원은 스테이크 레스토랑 중 최고였습니다. 부드러운 스테이크와 다양한 고기 메뉴로 기분 좋게 식사했습니다.', '2023-11-11')
INSERT INTO review (restaurant_name, title, content, created_at) VALUES ('해산물 파라다이스', '신선한 해산물의 향연', '해산물 파라다이스는 해산물의 매력적인 맛을 제공했습니다. 신선한 해산물과 훌륭한 소스로 가득 찬 메뉴는 꼭 시도해봐야 합니다.', '2023-11-12')
INSERT INTO review (restaurant_name, title, content, created_at) VALUES ('이탈리안 피자 퍼펙션', '이탈리안 피자의 정점', '이탈리안 피자 퍼펙션은 진정한 이탈리안 피자의 맛을 즐길 수 있는 곳이었습니다. 박식한 피자와 친절한 서비스로 훌륭한 경험을 제공했습니다.', '2023-11-13')
INSERT INTO review (restaurant_name, title, content, created_at) VALUES ('멕시칸 타코 페스트', '멕시코 음식의 매력', '멕시칸 타코 페스트는 멕시코 음식의 정통 맛을 즐길 수 있는 곳입니다. 매운 향과 신선한 재료로 기분 좋게 식사했습니다.', '2023-11-14')
INSERT INTO review (restaurant_name, title, content, created_at) VALUES ('판다 마스터', '중국 요리의 정통 맛', '중국 요리 마스터는 중국 음식을 사랑하는 이들에게 추천합니다. 정통 중식의 풍미를 경험할 수 있었습니다.', '2023-11-15')
INSERT INTO review (restaurant_name, title, content, created_at) VALUES ('일본 요식당', '건강한 채소 중심 요리', '신선한 채소 레스토랑에서는 건강하고 맛있는 채소 중심의 요리를 즐길 수 있습니다. 신선한 재료와 다양한 레시피로 만족스러운 식사를 즐겼습니다.', '2023-11-16')
INSERT INTO review (restaurant_name, title, content, created_at) VALUES ('프렌치 브리스트로', '프렌치 요리의 정통 맛', '프렌치 브리스트로는 프렌치 요리의 정통 맛을 경험할 수 있는 곳입니다. 부드러운 크로와상과 커피는 완벽한 조합이었습니다.', '2023-11-17')
INSERT INTO review (restaurant_name, title, content, created_at) VALUES ('아시안 퓨전', '아시안 요리의 다양성', '아시안 퓨전 카페에서는 아시아의 다양한 요리를 만날 수 있었습니다. 맛있는 아시안 요리의 진정한 대표입니다.', '2023-11-18')
INSERT INTO review (restaurant_name, title, content, created_at) VALUES ('바베큐 킹덤', '고기의 왕국', '바베큐 킹덤은 고기를 사랑하는 이들에게는 꼭 가볼만한 곳입니다. 훌륭한 바비큐와 갖가지 소스로 흥미진진한 식사를 즐겼습니다.', '2023-11-19')
INSERT INTO review (restaurant_name, title, content, created_at) VALUES ('일본 요식당', '일식의 향연', '일본 요식당에서는 일식의 정통 맛을 경험했습니다. 신선한 초밥과 회는 매우 맛있었습니다.', '2023-11-20')
INSERT INTO review (restaurant_name, title, content, created_at) VALUES ('미소식당', '중동 요리의 맛', '케밥 타임은 중동 요리의 맛을 경험할 수 있는 곳입니다. 훌륭한 풍미와 다양한 케밥 종류가 기억에 남습니다.', '2023-11-21')
INSERT INTO review (restaurant_name, title, content, created_at) VALUES ('햄버거 헤븐', '햄버거의 천국', '햄버거 헤븐에서는 정말로 맛있는 햄버거를 찾을 수 있었습니다. 큰 패티와 신선한 재료로 만든 햄버거는 완벽했습니다.', '2023-11-22')
INSERT INTO review (restaurant_name, title, content, created_at) VALUES ('바베큐 킹덤', '고품질 스테이크', '스테이크 하우스에서는 고기를 사랑하는 사람에게 완벽한 장소입니다. 부드러운 스테이크와 훌륭한 와인 목록으로 기분 좋게 식사했습니다.', '2023-11-23')
INSERT INTO review (restaurant_name, title, content, created_at) VALUES ('카리브', '카리브 음식의 풍부한 맛', '카리브 해외 요리는 엄격한 맛을 원하는 사람에게 추천합니다. 훌륭한 해산물과 매운 향이 기억에 남습니다.', '2023-11-24')
INSERT INTO review (restaurant_name, title, content, created_at) VALUES ('프렌치 브리스트로', '풍요로운 아침식사', '프렌치 브런치 카페는 아침식사를 즐기기에 완벽한 장소입니다. 신선한 재료로 만든 브런치 메뉴로 아침을 즐겼습니다.', '2023-11-25')
INSERT INTO review (restaurant_name, title, content, created_at) VALUES ('일본 요식당', '일식의 맛을 탐험', '스시 삶의 예술은 일식의 맛을 경험하는 데 최적의 장소입니다. 신선한 생선과 심미적인 접시로 식사의 즐거움을 느꼈습니다.', '2023-11-26')
INSERT INTO review (restaurant_name, title, content, created_at) VALUES ('아시안 퓨전', '동남아시아의 다양한 맛', '동남아시아 요리 정통 레스토랑에서는 동남아시아의 맛을 만끽할 수 있습니다. 레몬그라스와 맛있는 특별 요리가 훌륭했습니다.', '2023-11-27')
